INSERT INTO `cmdb_ci` VALUES (479572181131264, 'Team', '分组', NULL, 'tsfont-ci', 482263699349504, NULL, NULL, 2, 3, 0, 0, 0, 1, NULL, '<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<ci>\r\n   <!--模型属性定义，需要SQL语句返回对应列-->\r\n  <attrs>\r\n    <attr name=\"user_id\" label=\"用户id\"/>\r\n    <attr name=\"user_name\" label=\"用户名\"/>\r\n    <attr name=\"teamName\" label=\"分组\"/>\r\n  </attrs>\r\n  <sql>\r\n    SELECT\r\n    <!--必须包含id字段，作为配置项主键-->\r\n    `u`.`id` AS id,\r\n    <!--必须包含uuid字段，数据类型是char(32)，作为配置项全局主键-->\r\n    md5(`u`.`id`) AS uuid,\r\n    <!--必须包含name字段，作为配置项名称-->\r\n    `u`.`user_name` AS name,\r\n    <!--属性列需要在上面attrs中定义才生效-->\r\n    `u`.`user_id` as user_id,\r\n    `u`.`user_name` as user_name,\r\n    group_concat( `t`.`name`) AS teamName\r\n    FROM\r\n    `user` `u`\r\n    LEFT JOIN `user_team` `ut` \r\n    ON `u`.`uuid` = `ut`.`user_uuid`\r\n    LEFT JOIN `team` `t` \r\n    ON `t`.`uuid` = `ut`.`team_uuid`\r\n    GROUP BY u.uuid\r\n  </sql>\r\n</ci>', 0);
